script: |
  super -f tsv -I q6123.sql | sort > q6123.out

vector: true

inputs:
  - name: q6123.sql
    data: |
      pragma pg
      SELECT DISTINCT CAST ( NULL AS INTEGER ) AS col0 FROM tab0 GROUP BY col0, col0 HAVING NOT ( + ( - - MAX ( - - ( - col0 ) ) ) ) IN ( 19 );
  - name: tab0

outputs:
  - name: q6123.out
    data: |
      NULL
